import Modal from "./Modal";
import "./Cart.css";

function Cart() {

    const cartItems = <ul className="cart-items">{[{id: "c1", name: "sushi", amount: "2", price: "$15"}].map((cartItem) => {
        return <li>{cartItem.name}</li>;
    })}</ul>

    return (
        <Modal>
            {cartItems}
            <div className="total">
                <span>Total Amount</span>
                <span>35.52</span>
            </div>
            <div className="actions">
                <button className="button--alt">Close</button>
                <button className="button">Order</button>
            </div>
        </Modal>
    );
}

export default Cart;
